import React from 'react';
import Employee from './Employee';


const Employees = ({ staff }) => (
  <div>
    <h2>Employees</h2>
    {staff.map((person, index) => (
      <Employee key={index} person={person} />
    ))}
  </div>
);

export default Employees;
